import btoa from "btoa";
import backend_uri from "../backend";

let username = "seabasketofficial@gmail.com";

let password = "Seabasket@1234";

export const getOrders = async () => {
  return fetch(`${backend_uri}/allorders/`, {
    method: "POST",
    headers: {
      Authorization: "Basic " + btoa(`${username}:${password}`),
    },
  })
    .then((response) => {
      console.log(response);
    })
    .catch((err) => {
      return err;
    });
};
